import React from "react";

const FooterPage = () => {
  return (
    <div className="main-footer">
      <div className="container">
        <div className="row"></div>
        {/* col1 */}
        <div className="col">
          <h4>Social Media</h4>
          <ul className="list">
            <li>LinkedIn</li>
            <li>Facebook</li>
            <li>Instagram</li>

          </ul>
        </div>
        </div>
        {/* col2 */}

        <div className="col">
          <h4>Social Media</h4>
          <ul className="list">
            <li>LinkedIn</li>
            <li>Facebook</li>
            <li>Instagram</li>

          </ul>
        </div>


        <h1>Footer Works</h1>
      </div>
      );
}

      export default FooterPage;
